$(document).ready(function(){function parseBULLET(content){var contentPairs=[];var valuePairs=[];var FINALOBJ;var tempNAME,tempVAL;contentPairs=content.match(/(?:#)(.*?)\s(.*?)(?=#|}|{|$)/g);for(i=0;i<contentPairs.length;i++){contentPairs[i]=contentPairs[i].substring(1,contentPairs[i].length);tempNAME=contentPairs[i].match(/^[^\s]+(?=\s)/);tempVAL=contentPairs[i].substring(tempNAME[0].length+1,contentPairs[i].length);if(tempVAL.match(/\[(.*?),(.*?)\]/)){tempVAL=JSON.parse(tempVAL);valuePairs[i]='"'+tempNAME+'":['+tempVAL+"]";console.log(valuePairs[i])}else{valuePairs[i]='"'+tempNAME+'":"'+tempVAL+'"'}}eval("FINALOBJ = {"+valuePairs+"}");console.log(FINALOBJ);return FINALOBJ}var BULLETFILE="#name bullet#num 0.0.1#text beta#array [234,34]#hello world";parseBULLET(BULLETFILE);window.Bullet=parseBULLET})
